import React from "react";
import styles from './MainSection.module.scss';


const printStudents = (user) => {
  return (
    <div>
      <span>Student : </span>{user.name}
      <div>{user.role}</div>
    </div>
  )
}

const printDriver = (user) => {
  return (
    <div>
      <span>Driver : </span>{user.name}
      <div>{user.role}</div>
    </div>
  )
}

export function MainSection({userData})  {
  return(
    <div className={styles.mainSectionDiv}>
      {userData.map((user) => {
        if (user.role === 'student'){
          <div className={styles.mainSectionDiv}>{printStudents(user)}</div>
        } else if (user.role === 'driver') {
          <div className={styles.mainSectionDiv}>{printDriver}</div>
        }}
      )}
    </div>
  )
}
